    false,nt"url": null,nt"notes": "This narrative report for Red Rock Lakes
    National Wildlife Refuge outlines Refuge accomplishments from May 1944 to April
    1945. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, big
    game animals, furbearers, and predators- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing, haying, fur harvesting, and timber
    removal. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, and fishing. Items of interest,
    N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
